def all_left_truncatable_prime(nums):
    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(n ** 0.5) + 1):
            if n % i == 0:
                return False
        return True

    def is_left_truncatable_prime(n):
        s = str(n)
        while s:
            if not is_prime(int(s)):
                return False
            s = s[1:]
        return True

    x = nums[64]
    primes = []
    for i in range(2, x):
        if is_prime(i) and is_left_truncatable_prime(i):
            primes.append(i)
    return sorted(primes, reverse=True)
